import React from 'react'
import {useSpring, animated} from 'react-spring'
import circle from '../images/circle.png'
import leaf from '../images/leaf.png'
import brush from '../images/brush.png'
import Toggle from './toggl'


const Circular = () => {


  // const styles = useSpring({
  //   loop: true,
  //   to: [
  //     { opacity: 1, color: '#97c441' },
  //     { opacity: 1, color: '#55cbf9' },
  //     { opacity: 0.5, color: '#ff952b' },
  //   ],
  //   from: { opacity: 0, color: 'red' },
  // })

  const leafStyles = useSpring({

    to: [
      { opacity: 0.1,  },
      { opacity: 0.5,  },
      { opacity: 1  },
    ],
    from: { opacity: 0.1,  },
    delay: 2000,
    config :{
      duration: 1000
    }
  })

  const gearStyles = useSpring({

    to: [
      { opacity: 0.1,  },
      { opacity: 0.5,  },
      { opacity: 1  },
    ],
    from: { opacity: 0,  },
    delay: 3000,
    config :{
      duration: 1000
    },
  })

  const brushStyles = useSpring({

    to: [
      { opacity: 0.1,  },
      { opacity: 0.5,  },
      { opacity: 1  },
    ],
    from: { opacity: 0,  },
    delay: 4000,
    config :{
      duration: 1000
    }
  })

  return (
    <div className='conatiner'>
      <div className='conatiner-fluid'>
        <div className='row'>
          <div className='col-md-12 text-center '>
          <div className='loading'>
          <div className='loading-text'>
            <animated.div style={leafStyles} >Environment</animated.div>
            <animated.div style={gearStyles} >Technology</animated.div>
            <animated.div style={brushStyles} >Skill</animated.div>
          </div>

            < div  className='loading-img'>
              {/* <Toggle /> */}
              < animated.img style={leafStyles} src={circle} alt="img"></animated.img>
              < animated.img style={gearStyles} src={leaf} alt="img"></animated.img>
              < animated.img style={brushStyles} src={brush} alt="img"></animated.img>
            </ div>

          </div>
          </div>
        </div>
      </div>
    </div>
  )
}

export default Circular
